 pro správu událostí, ale nefunguje?','i-cursor'=>'i-kurzor','Icon'=>'Ikona','Icon Background Color'=>'Barva pozadí ikony','Icon Before Title'=>'Ikona před názvem','Icon Color'=>'Barva ikony','Icon Indicator'=>'Ikona indikátoru','Icon Library'=>'Knihovna ikon','Icon Settings'=>'Nastavení ikon','Icon/class name....'=>'Ikona/název třídy....','id-badge'=>'id-badge','id-card'=>'občanský průkaz','id-card-alt'=>'id-card-alt','If the icons are not working and you want to disable Font Awesome loading from the plugin, select Yes.'=>'Pokud ikony nefungují a chcete zakázat načítání Font Awesome z pluginu, vyberte Ano.','If the icons are not working, and you want to remove Flat Icon load from the plugin, select "Yes."'=>'Pokud ikony nefungují a chcete z pluginu odstranit načítání plochých ikon, vyberte „Ano“.','If you enable this then a Widget area will be registred and you can add any widgets from the Widget Menu. By default its disabled'=>'Pokud tuto možnost povolíte, bude zaregistrována oblast Widgetů a budete moci přidat libovolné widgety z nabídky Widgetů. Ve výchozím nastavení je tato možnost zakázána.','If you encounter a Fatal Error message on the event details page, you can enable this patch and check if the error persists. However, if there is no error, we recommend keeping the patch disabled'=>'Pokud se na stránce s podrobnostmi o události zobrazí zpráva o závažné chybě, můžete tuto opravu povolit a zkontrolovat, zda chyba přetrvává. Pokud se však žádná chyba nevyskytuje, doporučujeme ponechat opravu vypnutou.','If you encounter the message "Sorry, There Are No Seats Available" after updating to version 4.3.0 or later, you may enable this setting. Otherwise, please keep it unchanged.'=>'Pokud se po aktualizaci na verzi 4.3.0 nebo novější zobrazí zpráva „Je nám líto, nejsou k dispozici žádná místa“, můžete toto nastavení povolit. Jinak jej prosím ponechte beze změny.','If you have saved organizer details, please select the "Organizer" option. Please note that if you select "Organizer" and have not checked the organizer from the Event Organizer list on the right sidebar, the Event Location section will not populate on the front end.'=>'Pokud máte uložené údaje o organizátorovi, vyberte prosím možnost „Organizátor“. Upozorňujeme, že pokud vyberete možnost „Organizátor“ a nezaškrtnete organizátora v seznamu Organizátor události na pravém postranním panelu, sekce Místo konání události se na frontendu nezobrazí.','If you reset this count, all booking information will be removed, including the attendee list. This action is irreversible, so please be sure before you proceed.'=>'Pokud tento počet resetujete, všechny informace o rezervaci budou odstraněny, včetně seznamu účastníků. Tato akce je nevratná, proto se před pokračováním ujistěte, že jste to dokázali.','If you visit attendee list menu in event section then you will see all attendee list here. You can filter choosing event name and date if event is recurring event. After filtering right section there is 2 button to export attendee and extra service.'=>'Pokud v sekci událostí navštívíte nabídku seznamu účastníků, uvidíte zde seznam všech účastníků. Můžete filtrovat výběrem názvu události a data, pokud se jedná o opakující se událost. Po filtrování v pravé části se nacházejí 2 tlačítka pro export účastníků a doplňkových služeb.','If you visit Event settings page then You will see PDF email tab top right, you can configure pdf email here.'=>'Pokud navštívíte stránku nastavení události, uvidíte vpravo nahoře záložku PDF e-mail, kde můžete nakonfigurovat PDF e-mail.','If you want to display the ticket type list with an add-to-cart button on any post or page of your website, simply copy the shortcode and paste it where desired.'=>'Pokud chcete zobrazit seznam typů tiketů s tlačítkem pro přidání do košíku v jakémkoli příspěvku nebo na jakékoli stránce vašeho webu, jednoduše zkopírujte shortcode a vložte jej na požadované místo.','If you want to enable event data available in the Rest API Please enable this.'=>'Pokud chcete povolit data událostí dostupná v Rest API, povolte tuto funkci.','If you want to hide the expired event from the calendar please select Yes. Its applicable for the Free Calendar'=>'Pokud chcete skrýt událost s prošlou platností v kalendáři, vyberte možnost Ano. Platí to pro bezplatný kalendář.','If you want to show the date and time in your local timezone, please select Yes.'=>'Pokud chcete zobrazit datum a čas ve vašem místním časovém pásmu, vyberte Ano.','If you want to show the time zone with the date and time, please select "Yes".'=>'Pokud chcete zobrazit časové pásmo s datem a časem, vyberte možnost „Ano“.','If you want your event to be removed from the list once it is fully booked, you can select "Yes" here.'=>'Pokud chcete, aby vaše událost byla po jejím úplném obsazení ze seznamu odstraněna, můžete zde vybrat „Ano“.','If you would like to hide the location details from the order details section on the thank you page and confirmation email body, please choose "Yes". If you would like to show the location details, please choose "No". The default setting is "No".'=>'Pokud chcete skrýt podrobnosti o poloze v sekci s podrobnostmi objednávky na stránce s poděkováním a v těle potvrzovacího e-mailu, vyberte prosím „Ano“. Pokud chcete podrobnosti o poloze zobrazit, vyberte prosím „Ne“. Výchozí nastavení je „Ne“.','If your event is online or virtual, please ensure that this option is enabled.'=>'Pokud se vaše akce koná online nebo virtuálně, ujistěte se prosím, že je tato možnost povolena.','If your event list page is loading slowly, you can select this option to improve performance. Keep in mind that selecting this option will disable Waitlist and Seat count features. '=>'Pokud se stránka se seznamem událostí načítá pomalu, můžete vybrat tuto možnost pro zlepšení výkonu. Mějte na paměti, že výběrem této možnosti deaktivujete funkce čekací listiny a počtu míst k sezení.','If your theme is not loading the Owl Carousel Library, or 